// src/components/GenderSelection.tsx
import React from 'react';
import { Container, Typography, Button } from '@mui/material';
import { useNavigate } from 'react-router-dom';

const GenderSelection: React.FC = () => {
  const navigate = useNavigate();

  const handleGenderSelection = (gender: string) => {
    navigate(`/body-type/${gender}`);
  };

  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Choisissez votre sexe
      </Typography>
      <Button variant="contained" color="primary" onClick={() => handleGenderSelection('male')}>
        Homme
      </Button>
      <Button variant="contained" color="secondary" onClick={() => handleGenderSelection('female')}>
        Femme
      </Button>
    </Container>
  );
};

export default GenderSelection;
